def createSearchTerm(city, state):
    originalSearchTerm = f"https://www.google.com/search?q=coordinates+Canada+{city.replace(' ', '+')}+{state.replace(' ', '+')}" 
    print("originalSearchTerm : ", originalSearchTerm)
    return originalSearchTerm

def dms_to_dd(d, m, s, direction):  
    dd = float(d) + float(m)/60 + float(s)/3600  
    if direction in ['S', 'W']:  
        dd *= -1  
    return dd 

def parse_dms(dms_str):  
    dms_str = dms_str.replace('°', ' ').replace('′', ' ').replace('″', ' ')  
    parts = dms_str.split()  
    lat = dms_to_dd(parts[0], parts[1], parts[2], parts[3])  
    lon = dms_to_dd(parts[4], parts[5], parts[6], parts[7])  
    return lat, lon 

def convert_to_decimal_degrees(coord_str):  
    parts = coord_str.split(', ')  
    lat_str, lon_str = parts[0], parts[1]  
    lat_value = float(re.search(r"[-+]?\d*\.\d+|\d+", lat_str).group())  
    lon_value = float(re.search(r"[-+]?\d*\.\d+|\d+", lon_str).group())  
    if 'S' in lat_str:  
        lat_value = -lat_value  
    if 'W' in lon_str:  
        lon_value = -lon_value  
    return lat_value, lon_value 

